import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { getCurrentUser, authAPI } from '../utils/auth';

const HomeNavbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [isProfileDropdownOpen, setIsProfileDropdownOpen] = useState(false);
  const history = useHistory();
  const currentUser = getCurrentUser();

  const handleLogout = () => {
    try { 
      authAPI.logout();
    } catch (e) {}
    setIsOpen(false);
    setIsProfileDropdownOpen(false);
    history.push('/');
  };

  const handleProfileClick = () => {
    setIsProfileDropdownOpen(!isProfileDropdownOpen);
  };

  return (
    <nav className="navbar-home">
      <div className="navbar-container">
        {/* Logo */}
        <div className="navbar-logo">
          <div className="logo-container">
            <div className="logo-icon">
              <svg width="40" height="40" viewBox="0 0 40 40" fill="none">
                <defs>
                  <linearGradient id="logoGradient" x1="0%" y1="0%" x2="100%" y2="100%">
                    <stop offset="0%" stopColor="#6366f1" />
                    <stop offset="50%" stopColor="#8b5cf6" />
                    <stop offset="100%" stopColor="#06b6d4" />
                  </linearGradient>
                </defs>
                <circle cx="20" cy="20" r="18" fill="url(#logoGradient)" fillOpacity="0.1" stroke="url(#logoGradient)" strokeWidth="2"/>
                <path d="M12 16L20 24L28 16" stroke="url(#logoGradient)" strokeWidth="3" strokeLinecap="round" strokeLinejoin="round"/>
                <circle cx="15" cy="12" r="2" fill="url(#logoGradient)"/>
                <circle cx="25" cy="12" r="2" fill="url(#logoGradient)"/>
                <circle cx="20" cy="28" r="2" fill="url(#logoGradient)"/>
                <path d="M8 20H12M28 20H32" stroke="url(#logoGradient)" strokeWidth="2" strokeLinecap="round"/>
              </svg>
            </div>
            <div className="logo-text">
              <span className="logo-name">PR LEARNINGS</span>
              <span className="logo-tagline">Platform</span>
            </div>
          </div>
        </div>

        {/* Navigation Links */}
        <div className="nav-center">
          <ul className="navbar-links">
            <li><Link to="/home" onClick={() => setIsOpen(false)}>Home</Link></li>
            <li><Link to="/dashboard" onClick={() => setIsOpen(false)}>Dashboard</Link></li>
            <li><Link to="/career-assessment" onClick={() => setIsOpen(false)}>Career Assessment</Link></li>
            <li><Link to="/roadmap" onClick={() => setIsOpen(false)}>Learning Paths</Link></li>
            <li><Link to="/projects" onClick={() => setIsOpen(false)}>Projects</Link></li>
            <li><Link to="/resources" onClick={() => setIsOpen(false)}>Resources</Link></li>
          </ul>
        </div>

        {/* Profile and Actions */}
        <div className="nav-right">
          <div className="profile-section">
            {/* Profile Circle */}
            <div className="profile-container">
              <button 
                className="profile-circle" 
                onClick={handleProfileClick}
                aria-label="Profile menu"
              >
                {currentUser?.username ? (
                  currentUser.username.charAt(0).toUpperCase()
                ) : (
                  'U'
                )}
              </button>
              
              {/* Profile Dropdown */}
              {isProfileDropdownOpen && (
                <div className="profile-dropdown">
                  <div className="profile-info">
                    <div className="profile-avatar">
                      {currentUser?.username ? (
                        currentUser.username.charAt(0).toUpperCase()
                      ) : (
                        'U'
                      )}
                    </div>
                    <div className="profile-details">
                      <h4>{currentUser?.username || 'User'}</h4>
                      <p>{currentUser?.email || 'user@example.com'}</p>
                    </div>
                  </div>
                  <div className="profile-actions">
                    <Link to="/profile" onClick={() => setIsProfileDropdownOpen(false)}>
                      <svg width="16" height="16" viewBox="0 0 24 24" fill="none">
                        <path d="M20 21V19C20 17.9391 19.5786 16.9217 18.8284 16.1716C18.0783 15.4214 17.0609 15 16 15H8C6.93913 15 5.92172 15.4214 5.17157 16.1716C4.42143 16.9217 4 17.9391 4 19V21" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        <circle cx="12" cy="7" r="4" stroke="currentColor" strokeWidth="2"/>
                      </svg>
                      Profile
                    </Link>
                    <button onClick={handleLogout}>
                      <svg width="16" height="16" viewBox="0 0 24 24" fill="none">
                        <path d="M9 21H5C4.46957 21 3.96086 20.7893 3.58579 20.4142C3.21071 20.0391 3 19.5304 3 19V5C3 4.46957 3.21071 3.96086 3.58579 3.58579C3.96086 3.21071 4.46957 3 5 3H9" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        <path d="M16 17L21 12L16 7" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        <path d="M21 12H9" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      Logout
                    </button>
                  </div>
                </div>
              )}
            </div>
          </div>

          {/* Mobile Menu Button */}
          <button
            className={`navbar-toggle ${isOpen ? 'active' : ''}`}
            aria-label="Toggle navigation"
            aria-expanded={isOpen}
            onClick={() => setIsOpen((v) => !v)}
          >
            <span />
            <span />
            <span />
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      <div className={`mobile-menu ${isOpen ? 'open' : ''}`}>
        <ul>
          <li><Link to="/home" onClick={() => setIsOpen(false)}>Home</Link></li>
          <li><Link to="/dashboard" onClick={() => setIsOpen(false)}>Dashboard</Link></li>
          <li><Link to="/career-assessment" onClick={() => setIsOpen(false)}>Career Assessment</Link></li>
          <li><Link to="/roadmap" onClick={() => setIsOpen(false)}>Learning Paths</Link></li>
          <li><Link to="/projects" onClick={() => setIsOpen(false)}>Projects</Link></li>
          <li><Link to="/resources" onClick={() => setIsOpen(false)}>Resources</Link></li>
          <li><Link to="/profile" onClick={() => setIsOpen(false)}>Profile</Link></li>
          <li><button onClick={handleLogout}>Logout</button></li>
        </ul>
      </div>
    </nav>
  );
};

export default HomeNavbar;
